import React, { Component } from 'react';
import base from '../../config/api.js';
import log from '../../assets/img/log.png';
let api = base.api();

class Home extends Component {
    constructor(props) {
        super(props);
        this.state = {
            message: ""
        };
    }
    render() {
        return (
            <article>
                <h1 className="center">Webbklient till Kmom10, vlinux</h1>
                <p>Web Client to filter and search for IP address, URLs, days, months, times, days & times and Months, Days & Times from the log file.</p>
                <div className="home"><img src={log} className="log" alt="log file" />Log file.</div>
            </article>
        );
    }
}

export default Home;
